void computeS3::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"input1_V_V_TDATA\" :  \"" << input1_V_V_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"inputGrp_V_V_TDATA\" :  \"" << inputGrp_V_V_TDATA.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"outputGrp_V_V_TDATA\" :  \"" << outputGrp_V_V_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s3_out_V_V_TDATA\" :  \"" << s3_out_V_V_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"inputGrp_V_V_TVALID\" :  \"" << inputGrp_V_V_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"inputGrp_V_V_TREADY\" :  \"" << inputGrp_V_V_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"input1_V_V_TVALID\" :  \"" << input1_V_V_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"input1_V_V_TREADY\" :  \"" << input1_V_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"outputGrp_V_V_TVALID\" :  \"" << outputGrp_V_V_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"outputGrp_V_V_TREADY\" :  \"" << outputGrp_V_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s3_out_V_V_TVALID\" :  \"" << s3_out_V_V_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s3_out_V_V_TREADY\" :  \"" << s3_out_V_V_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

